import { StyleSheet, Text, TouchableOpacity, View } from 'react-native'
import React from 'react'

const Contact = ({navigation}) => {
  return (
    <View>
      <Text>Contact</Text>
      <TouchableOpacity
      onPress={()=>{
        {navigation.navigate('about')}
      }}
      >
        <Text>
          Go to about
        </Text>
      </TouchableOpacity>
    </View>
  )
}

const styles = StyleSheet.create({})
export default Contact
